エアコンフィルター交換で車内を快適空間に。PIAAエアコンフィルターcomfort カーエアコン用純正交換タイプ。<div class="nostocks">※ご注文後お取り寄せ商品につき、弊社に在庫がございません。<br>納期はお気軽にお問い合わせください。</div><div class="Merit"><b>＜特長＞</b><p>●花粉症、アレルギーの方には、不繊布＋帯電不織布のPIAAエアコンフィルターcomfortがオススメです。●静電気で強力キャッチ！細かいゴミを吸着。エアコンの風量確保。●ハウスダスト・花粉を99.9％シャットアウト！（メーカー測定値）●強力な集塵性能。車内に漂う「ホコリ・黄砂」「花粉」「ダニ」「排ガス粒子」「タバコ粒子」もキャッチ。ディーゼル粉塵などの1ミクロン以下の微細な汚れも高い確率でカット。車内の汚れた空気をクリーンに保ちます。●環境汚染物質「PM2.5」対策に。●画期的な2層濾紙構造。静電気で微粒子までキャッチする特殊製法の帯電フィルターと、濾過性、通気性に優れた不織布フィルターの2層濾紙で強力に空気の汚れをキャッチ。●取付け簡単。●交換目安：1年に1回または10000km走行</p></div><div class="Spec"><b>＜仕様＞</b><p><br>◆トヨタ車用：アリスト、アルテッツァ/ジータ、クラウン、クルーガー、マークII ブリッド<br>　※対応車種については別途ご確認下さい。<br>◆代表純正部品番号：87139-48030<br></p></div><style type="text/css"><!--
