ドライブするほど、うるおう美肌。Airy（エアリー）C<div class="nostocks">※ご注文後お取り寄せ商品につき、弊社に在庫がございません。<br>納期はお気軽にお問い合わせください。</div><div class="Merit"><b>＜特長＞</b><p>●フィルター濾紙に癒着されたビタミンセラミックが、大気中の水分と融合し、ビタミンC誘導体として空気中に放出され、お肌に浸透。●ホコリ、花粉を静電気（エレクトリックフィルター）で強力にカット。●ビタミンC配合不織布フィルター＋エレクトリックフィルターのツインパワー濾紙は優れた除塵性能を保ちながら、エアコン風量を遮ることなく維持し、カーエアコンの冷暖房効率を最大限に発揮します。●1ミクロン以下の微粒子をカット。●交換目安：走行15000kmまたは1年に1回。</p></div><div class="Spec"><b>＜仕様＞</b><p><br><strong>注意事項</strong><br>◆ご使用のまえに、同梱の交換要領書をよくお読みの上、正しくお使いください。<br>◆適用は、メーカーページのカーエアコンフィルター車種別適用表をご参照ください。<br>◆交換作業が不明な点は車両の取扱説明書をご参照ください。<br>◆交換作業は必ずエアコン及びエンジンを停止して行ってください。<br>◆本製品には表と裏があります。間違えて取り付けると風量がおちることがあります。<br>◆車両のグレードやフィルター未装着車への取り付けに際しましては、別途パーツが必要な場合があります。<br>◆本製品の交換後、必ずエアコンを作動させ、異常がないことを確認してください。<br>◆特に粉塵の多い地域や交通量の多い地域では、早めの交換が効果的です。<br>◆本製品は、カーエアコンフィルター以外の用途では使用しないでください。<br>◆フィルター周囲にはスポンジが貼付されております。このスポンジは外さずに交換をしてください。<br>◆使い捨てタイプとなりますので、洗浄しての再生使用はできません。<br>◆本製品は美容を目的としたものではありません。<br></p></div><style type="text/css"><!--
